import React, { useState, useEffect } from "react";

// components
import CardTable from "components/Cards/CardTable.js";

export default function Tables() {
  const [visitors, setVisitors] = useState([]);

  // Fetch visitors logic
  useEffect(() => {
    const fetchVisitors = async () => {
      try {
        const response = await fetch("/api/visitors"); // Replace with your API endpoint
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        const data = await response.json();
        setVisitors(data);
      } catch (error) {
        console.error("Error fetching visitors:", error);
      }
    };

    fetchVisitors();
  }, []);

  return (
    <>
      <div className="flex flex-wrap mt-4">
        <div className="w-full mb-12 px-4">
          {/* Pass visitors data to CardTable */}
          <CardTable visitors={visitors} />
        </div>
        <div className="w-full mb-12 px-4">
          {/* You can pass a different set of visitors or a different color */}
          <CardTable color="dark" visitors={visitors} />
        </div>
      </div>
    </>
  );
}
